import './navbar.scss'

export default function Navbar(){
    return (
        <div className = "navbar">
            <div><a href ="/" style="transition-delay: 100ms;"> <p><i class="fas fa-code"></i> Home</p></a></div>
            <div><a href ="#about"> <p><i class="fas fa-code"></i> About</p></a></div>
            <div><a href ="#skills"> <p><i class="fas fa-code"></i> Skills</p></a></div>
            <div><a href ="#projects"style="transition-delay: 400ms;"> <p><i class="fas fa-code"></i> Projects</p></a></div>
            <div className = 'icons'>
                <a href="https://github.com/willianck"><i class="fab fa-github"></i></a>
                <a href= "https://www.linkedin.com/in/william-nafack-585210173/"><i class="fa-brands fa-linkedin"></i></a>
                <a href="mailto:williamnafack@outlook.com"><i class="fa-regular fa-envelope"></i></a>
            </div>
        </div>



    );
}
